sources.js/portfoilo.js:
$(function () {
    const btn = $('.lnb ul li')
    const page = $('.wrap div')



    let index = 0
    let top = 0

    btn.click(function () {
        index = $(this).index()
        top = page.eq(index).offset().top

        $('html, body').stop().animate({
            scrolltop: top
        }, 1000)

    })

    const indi = $('.indicate li')

    $('.indicate').css('top', $(window).height() / 2 - $('.indicate').height() / 2)




    $(window).scroll(function () {

        let point = $(this).scrollTop() + ($(window).height() / 2 - $('.indicate').height() / 2)

        $('.indicate').stop().animate({
            top: point
        }, 500)


        page.each(function () {
            let point = $(window).scrollTop()
            let index = $(this).index()

            if (point >= $(this).offset().top) {
                indi.removeClass('on')
                indi.eq(index).addClass('on')
            }
        })
    })

    indi.click(function () {
        $(window).scrollTo(this.hash || 0, 1000)
    })

    

    /*  */

    const $text = document.querySelector(".typing .text");

    // 글자 모음
    const letters = [
        "이 주 연",
    ];

    // 글자 입력 속도
    const speed = 100;
    let i = 0;

    // 타이핑 효과
    const typing = async () => {
        const letter = letters[i].split("");

        while (letter.length) {
            await wait(speed);
            $text.innerHTML += letter.shift();
        }

        // 잠시 대기
        await wait(900);

        // 지우는 효과
        remove();
    }

    // 글자 지우는 효과
    const remove = async () => {
        const letter = letters[i].split("");

        while (letter.length) {
            await wait(speed);

            letter.pop();
            $text.innerHTML = letter.join("");
        }

        // 다음 순서의 글자로 지정, 타이핑 함수 다시 실행
        i = !letters[i + 1] ? 0 : i + 1;
        typing();
    }

    // 딜레이 기능 ( 마이크로초 )
    function wait(ms) {
        return new Promise(res => setTimeout(res, ms))
    }

    // 초기 실행
    setTimeout(typing, 1500);
});
